mapper.select:
select 

from t_preposition_log
where TXNCODE = #{txncode,jdbcType=VARCHAR}
  and SYSSESQ = #{syssesq,jdbcType=VARCHAR}
  and REQSEQ = #{reqseq,jdbcType=VARCHAR}

mapper.delete:
delete from t_preposition_log
where TXNCODE = #{txncode,jdbcType=VARCHAR}
  and SYSSESQ = #{syssesq,jdbcType=VARCHAR}
  and REQSEQ = #{reqseq,jdbcType=VARCHAR}
